import React from 'react';
import Header from './component/Header';
import { Container } from 'semantic-ui-react';
import PageBody from './component/PageBody';

function App() {
  return (
    <Container textAlign="center" style={{ margin: '2em' }}>
      <Header />
      <PageBody />
    </Container>
  );
}

export default App;
